void RootComponent::setAudioProcessor(RNBO::JuceAudioProcessor *p)
{
    processor = p;

    RNBO::ParameterInfo parameterInfo;
    RNBO::CoreObject& coreObject = processor->getRnboObject();

    for (unsigned long i = 0; i < coreObject.getNumParameters(); i++) {
        auto parameterName = coreObject.getParameterId(i);
        RNBO::ParameterValue value = coreObject.getParameterValue(i);
        Slider *slider = nullptr;
        ComboBox *combobox = nullptr;
        Button *button = nullptr;
        if (juce::String(parameterName) == juce__slider.get()->getName()) {
            slider = juce__slider.get();
        } else if (juce::String(parameterName) == juce__slider2.get()->getName()) {
            slider = juce__slider2.get();
        } else if (juce::String(parameterName) == juce__slider3.get()->getName()) {
            slider = juce__slider3.get();
        } else if (juce::String(parameterName) == juce__slider4.get()->getName()) {
            slider = juce__slider4.get();
        } else if (juce::String(parameterName) == juce__slider7.get()->getName()) {
            slider = juce__slider7.get();
        } else if (juce::String(parameterName) == juce__slider12.get()->getName()) {
            slider = juce__slider12.get();
        } else if (juce::String(parameterName) == juce__slider13.get()->getName()) {
            slider = juce__slider13.get();
        } else if (juce::String(parameterName) == juce__slider14.get()->getName()) {
            slider = juce__slider14.get();
        } else if (juce::String(parameterName) == juce__slider15.get()->getName()) {
            slider = juce__slider15.get();
        } else if (juce::String(parameterName) == juce__slider16.get()->getName()) {
            slider = juce__slider16.get();
        } else if (juce::String(parameterName) == juce__slider17.get()->getName()) {
            slider = juce__slider17.get();
        } else if (juce::String(parameterName) == juce__comboBox.get()->getName()) {
            combobox = juce__comboBox.get();
        } else if (juce::String(parameterName) == juce__comboBox2.get()->getName()) {
            combobox = juce__comboBox2.get();
        } else if (juce::String(parameterName) == juce__textButton.get()->getName()) {
            button = juce__textButton.get();
        } else if (juce::String(parameterName) == juce__textButton2.get()->getName()) {
            button = juce__textButton2.get();
        } else if (juce::String(parameterName) == juce__textButton3.get()->getName()) {
            button = juce__textButton3.get();
        } else if (juce::String(parameterName) == juce__textButton4.get()->getName()) {
            button = juce__textButton4.get();
        } else if (juce::String(parameterName) == juce__textButton8.get()->getName()) {
            button = juce__textButton8.get();
        } else if (juce::String(parameterName) == juce__textButton9.get()->getName()) {
            button = juce__textButton9.get();
        }

        if (slider) {
            slidersByParameterIndex.set(i, slider);
            coreObject.getParameterInfo(i, &parameterInfo);
            slider->setRange(parameterInfo.min, parameterInfo.max);
            slider->setValue(value);
        }
        if (combobox) {
            comboByParameterIndex.set(i, combobox);
            coreObject.getParameterInfo(i, &parameterInfo);
            combobox->setSelectedItemIndex(value);
        }
        if (button) {
            buttonsByParameterIndex.set(i, button);
            coreObject.getParameterInfo(i, &parameterInfo);
            button->setToggleState(value, NotificationType::dontSendNotification);
        }
    }
}

void RootComponent::updateSliderForParam(unsigned long index, double value)
{
    if (processor == nullptr) return;
    RNBO::CoreObject& coreObject = processor->getRnboObject();
    auto denormalizedValue = coreObject.convertFromNormalizedParameterValue(index, value);
    auto slider = slidersByParameterIndex.getReference((int) index);
    if (slider && (slider->getThumbBeingDragged() == -1)) {
        slider->setValue(denormalizedValue, NotificationType::dontSendNotification);
    }
    auto combobox = comboByParameterIndex.getReference((int) index);
    if (combobox) {
        combobox->setSelectedItemIndex(denormalizedValue, NotificationType::dontSendNotification);
    }
    auto button = buttonsByParameterIndex.getReference((int) index);
    if (button) {
        button->setToggleState(denormalizedValue, NotificationType::dontSendNotification);
    }
}

